import React from "react";

import {Link} from "react-router-dom";

import "../Style/Home.css"
function Home() {
  return (
    <div>
      <div className="container">
        <Link className="admin" onC>Admin</Link>
        <Link className="student">Student</Link>
      </div>
    </div>
  );
}

export default Home;
